// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.4.22 <0.9.0;
pragma abicoder v2;

import "./oracleAPI.sol";

contract RDF is OracleAPI {

    event LogNewProvableQuery(string description);
    event LogNewProvableResult(string result);

    // Variable for determining the id of the graph
    uint256 public grafCounter = 0;

    // Struct of graph
    struct Graph{
      address owner;
      uint256 date;
      string[] triplets;
    }

    // Mapping from graph ID to graph
    mapping(uint256 => Graph) graphs;

    /* mapping(uint256 => string[]) graphs; */

    /* mapping(uint256 => address) owners; */

    /* mapping(uint256 => string) metadatas; */

    address private owner;

    constructor() {
    }

    /**
    @notice funkcja do lodowania grafa
    @param _request: url address ktury zwruci graf
    */
    function uploadGraph(string memory _request) public payable{
        // emit LogNewProvableQuery("Provable query was sent, standing by for the answer...");
        owner = msg.sender;
        oracle.createRequest(_request,"");
    }

    /**
    @param  _result: zwrucony graf
    */
    function __callback(string memory _result) public {
        require(msg.sender == OracleAddress);
        string[] memory tmp = split(_result);
        graphs[grafCounter].triplets = tmp;
        graphs[grafCounter].owner = owner;
        graphs[grafCounter].date = block.timestamp;
        grafCounter++;
        emit LogNewProvableQuery("Upload graf");
    }

    function saveEditGraph(string[] memory _graph) public {
        // require(msg.sender == OracleAddress);
        // string[] memory tmp = split(_result);
        /* graphs[grafCounter] = _graph; */

        graphs[grafCounter].triplets = _graph;
        graphs[grafCounter].owner = msg.sender;
        graphs[grafCounter].date = block.timestamp;

        grafCounter++;
        emit LogNewProvableQuery("Upload graf");
    }

    /**
    * @notice funkcja do splitowania grafa
    * @dev funkcja dziala tylko wtedy gdy string ma posta <><><><><>...<><><>
    * @param _ontology_terms graf zapisany jako string
    * @return string[] tablicu trujek
    */
    function split(string memory _ontology_terms) private pure returns(string[] memory){
        uint256 ile = 0;
        bytes memory stringAsBytesArray = bytes(_ontology_terms);
        require(stringAsBytesArray[0] == '<', "Incorrect data format.");
        for(uint256 i = 0; i < stringAsBytesArray.length; i++){
            if(stringAsBytesArray[i] == '<'){
                ile++;
            }
        }

        string[] memory array = new string[](ile);
        ile = 0;
        uint256 count = 0;
        bytes memory tmp;

        for(uint256 i = 0; i < stringAsBytesArray.length; i++){
            if(count == 0){
                for(uint256 j = i; j < stringAsBytesArray.length; j++){
                    if(stringAsBytesArray[j] != '>'){
                        count++;
                    } else {
                        count++;
                        tmp = new bytes(count);
                        count = 0;
                        break;
                    }
                }
            }
            if(stringAsBytesArray[i] != '>'){
                tmp[count++] = stringAsBytesArray[i];
            } else {
                tmp[count++] = stringAsBytesArray[i];
                array[ile++] = string(tmp);
                count = 0;
            }
        }

        return array;
    }

    /**
    @notice poluczic graf po id
    @param _id jest indyfikatorem graf
    @return string[] tablica trujek
    */
    function getGraf(uint256 _id) public view returns(string[] memory){
      /* require(_id >= grafCounter, "Grafa o takim indyfikatorze nie istnieje."); */
      string[] memory tmp = new string[](graphs[_id].triplets.length);
      for(uint256 i = 0; i < graphs[_id].triplets.length; i++){
        tmp[i] = graphs[_id].triplets[i];
      }
      return tmp;
    }

    /**
    @notice poluczic adres wlasciciela grafu po id
    @param _id jest indefikatorem grafu
    @return _owner address wlascila grafu
    */
    function getOwner(uint256 _id) public view returns(address _owner){
      /* return owners[_id]; */
      /* require(_id >= grafCounter, "Grafa o takim indyfikatorze nie istnieje."); */
      return graphs[_id].owner;
    }

    /**
    @notice poluczic datu zapisania grafu
    @param _id jest indyfikatorem grafu
    */
    function getDateTime(uint256 _id) public view returns(uint256 _date){
      /* require(_id >= grafCounter, "Grafa o takim indyfikatorze nie istnieje."); */
      return graphs[_id].date;
    }

    /* function check_rdf(string memory _ontology_IRI, string memory _rdf_terms) public view returns(string memory){
        if(ontologies[_ontology_IRI].length > 0){
            string memory str = "";
            string[] memory rdfTerms = split(_rdf_terms);
            for(uint256 i = 0; i < rdfTerms.length; i++){
                for(uint j = 0; j < ontologies[_ontology_IRI].length; j++){
                    if(bytes(rdfTerms[i]).length == bytes(ontologies[_ontology_IRI][j]).length){
                        string memory tmp = ontologies[_ontology_IRI][j];
                        if(keccak256(bytes(rdfTerms[i])) == keccak256(bytes(tmp))){
                            str = string(abi.encodePacked(str, rdfTerms[i]));
                            break;
                        }
                    }
                }
            }
            return str;
        } else {
            return "ontology not found";
        }
    } */

}

